import React from 'react';
import '../../bootstrap-4.5.3-dist/css/bootstrap.min.css';

const Home_page = () => {
    return(
        <fieldset>
            <div className="field">
                <h1>Bem vindo querido bruxo, você está na melhor loja do Beco Vertical!</h1>
                <h4>
                    <br/> <br/>
                    Devido aos tempos que estamos passando o beco vertical foi renomeado como Web Vertical! Pois
                    agora como todos nós sabemos ela se situa aqui, na web! Meus parabéns por nos encontrar. <br/>
                    Inteja com os botões acima e "Accio"! Todas as nossas seções virão até você em um segundo.
                </h4>
            </div>
        </fieldset>
    );
}

export default Home_page;
